          </ul>
        </details>
      </li>
      <li><a>CONTACT</a></li>
      <li><a>CART</a></li>
    </ul>
  </div>
  <div className="navbar-end">
    <a className="btn">LOGOUT</a>
  </div>
</div>

  );
}

export default App;
